from typing import List
from functools import lru_cache
from itertools import accumulate
from bisect import bisect_left
import heapq


class Solution1:
    def furthestBuilding(self, heights: List[int], bricks: int, ladders: int) -> int:
        """MLE"""
        N = len(heights)
        hs = [(h - heights[i - 1], i) for i, h in enumerate(heights) if i > 0 and h > heights[i - 1]]
        M = len(hs)

        @lru_cache(maxsize=None)
        def helper(idx: int, bricks: int, ladders: int) -> int:
            if ladders < 0 or bricks < 0:
                return hs[idx - 1][1] - 1
            if idx == M:
                return N - 1
            res1 = helper(idx + 1, bricks, ladders - 1)
            res2 = helper(idx + 1, bricks - hs[idx][0], ladders)
            return max(res1, res2)

        return helper(0, bricks, ladders)


class Solution2:
    def furthestBuilding(self, heights: List[int], bricks: int, ladders: int) -> int:
        """LeetCode 1642

        Priority Queue to keep track of the ladders number of largest jumps
        so far. We keep track of the sum of the remaining jumps. Whenever that
        sum exceeds bricks, we have found the answer.

        This is from the hint.

        O(NlogN)
        
        UPDATE: less operation. Hopefully this is slightly faster
        """
        N = len(heights)
        heap = []  # min heap
        for i in range(1, len(heights)):
            if heights[i] > heights[i - 1]:
                heapq.heappush(heap, heights[i] - heights[i - 1])
                if len(heap) > ladders:
                    bricks -= heapq.heappop(heap)
                    if bricks < 0:
                        return i - 1
        return N - 1


